INSERT INTO `jobbole_article` VALUES ('2018 年，程序员要具备哪些核心竞争力？','2018-01-25 00:00:00','http://blog.jobbole.com/113525/','0208b3d12db7cfc54ed61c6f01dabacd','http://jbcdn2.b0.upaiyun.com/2016/07/b82c41ce36630a47a22e10059671eb52.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,6,6,'职场, 6 评论 ,程序员,职场','近日国外开发者平台 HankerRank 发布了 2018 年开发者技能调查报告，本文摘录程序员求职时必备技能相关的调查结果。\n相比中大型公司，小公司更为看中开发者对框架的熟练程度。因为小公司追求快启动，框架有助于开发者更快速地的推送代码。\n有一种流行的观点认为，招聘人员更中意有名牌大学 CS 学位的人选。但事实证明，他们实际上关心的是你所做的，而不是你上学的地方。绝大多数的招聘经理表示，他们寻找'),('如何对分布式 NewSQL 数据库 TiDB 进行性能调优','2018-04-10 00:00:00','http://blog.jobbole.com/113834/','051cf547a88e56c435894d7ce9d248b3','http://jbcdn2.b0.upaiyun.com/2017/03/4bae6998d00f180d42c7da716e3d0bb2.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,0,'IT技术,数据库','在分布式系统中进行调优不是开玩笑的事情。分布式系统中调优比单节点服务器调优复杂得多，它的瓶颈可能出现在任何地方，单个节点上的系统资源，子组件，或者节点间的协作，甚至网络带宽这些都可能成为瓶颈。性能调优就是发现并解决这些瓶颈的实践，直到系统达到最佳性能水平。我会在本文中分享如何对 TiDB 的“写入”操作进行调优，使其达到最佳性能的实践。\n 是开源的混合事务处理/分析处理（HTAP）的 NewSQL'),('最终一轮面试被 Google 刷掉，这是一种什么样的体验？','2018-04-16 00:00:00','http://blog.jobbole.com/113568/','072156c0f2153402aab100fbc555a4b8','http://jbcdn2.b0.upaiyun.com/2015/10/ec8b7891ca44138c9a9a09ee180cf33b.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,2,0,'职场,Google,职场','我应聘的是位于美国密歇根安娜堡分公司的 Associate Account Strategist，实质上是谷歌前线业务的销售岗，归谷歌 AdWords 部门管辖。\n整个招聘流程持续了大约一个月。如果顺利，应聘这个岗位要经历五轮面试。谷歌是在今年一月份给我发出面试邀请的。\n以前的招聘流程通常会更长，一个求职者要经历许多轮面试，通常为六个月或更长时间。 所以我没有什么可抱怨的，毕竟我的经历只有一个月。'),('创建订单实现幂等的一点思考','2018-04-10 00:00:00','http://blog.jobbole.com/113709/','0b814620d5a98d544ddba1dfe2b6faf2','http://jbcdn2.b0.upaiyun.com/2015/07/8266f93c2d45d97e0d52e71428ca372e.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,1,'IT技术, 1 评论 ,分布式,架构设计',''),('Linux 主目录中的隐藏文件是干什么用的？','2018-03-07 00:00:00','http://blog.jobbole.com/113719/','0ec536e6cc340e779e8be8c764ab39c0','http://jbcdn2.b0.upaiyun.com/2018/03/c96c574ca76e6b552476e508f1247902.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,0,'IT技术,Linux','在 Linux 系统中，你可能会在主目录中存储了大量文件和文件夹。但在这些文件之外，你知道你的主目录还附带了很多隐藏的文件和文件夹吗？如果你在主目录中运行 \n，你会发现一堆带有点前缀的隐藏文件和目录。这些隐藏的文件到底做了什么？\n通常，主目录中的隐藏文件和目录包含该用户程序访问的设置或数据。它们不打算让用户编辑，只需要应用程序进行编辑。这就是为什么它们被隐藏在用户的正常视图之外。\n通常，删除和修改'),('Linux 新用户？来试试这 8 款重要的软件','2018-03-21 00:00:00','http://blog.jobbole.com/113775/','1401d80b943d81d3493c295bfe34a3ab','http://jbcdn2.b0.upaiyun.com/2018/01/1b8322e1daff605d71fc81e724421f17.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,0,'IT技术,Linux','即便您不是计算机的新手，刚接触 Linux 时，通常都会面临选择使用应用软件的问题。在数百万 Linux 应用程序中，做起选择来并不轻松。本文中，您将能发现八个重要的 Linux 应用，帮助您快速选择应用程序。\n下面这些应用程序大多不是 Linux 独有的。如果有过使用 Windows/Mac 的经验，您很可能会熟悉其中一些软件。根据兴趣和需求，下面的程序可能不全符合您的要求，但是在我看来，清单里'),('请停止结对编程','2018-01-13 00:00:00','http://blog.jobbole.com/113474/','141819302e0a324b8883aa51f6c059d7','http://insights.thoughtworks.cn/wp-content/uploads/2018/01/1.jpeg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,2,'开发, 2 评论 ,结对编程',''),('为小白准备的重要 Docker 命令说明','2018-01-16 00:00:00','http://blog.jobbole.com/113490/','148acfe5c7841aeb6acee354b96cab45','http://jbcdn2.b0.upaiyun.com/2014/01/382b1251c2cdb32cf334445596f97085.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,2,1,'IT技术, 1 评论 ,Docker','在早先的教程中，我们学过了\n。 在本教程中，我们会学习管理 docker 容器的其他命令。\n要列出 docker 支持的所有命令，运行\n我们会看到如下结果，\n要进一步查看某个命令支持的选项，运行：\n就会列出 docker 子命令所支持的选项了。\n默认，所有镜像都是从 Docker Hub 中拉取下来的。我们可以从 Docker Hub 上传或下载操作系统镜像。为了检查我们是否能够正常地通过 Doc'),('如何在不会导致服务器宕机的情况下，用 PHP 读取大文件','2017-12-17 00:00:00','http://blog.jobbole.com/113339/','14c027911b193616950f9c0ad1de58fd','http://jbcdn2.b0.upaiyun.com/2015/01/ee9bc25f0b5757b6f90f093b53eb2271.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,5,1,'IT技术, 1 评论 ,php','很少情况下我们可能需要走出这个舒适的地方 ——比如当我们试图在一个大型项目上运行 Composer 来创建我们可以创建的最小的 VPS 时，或者当我们需要在一个同样小的服务器上读取大文件时。\n后面的问题就是我们将在本教程中深入探讨的。\n在 \n上可以找到本教程的源码。\n确保我们对代码有改进的唯一方法是测试一个不好的情况，然后将我们修复之后的测量与另一个进行比较。换句话说，除非我们知道“解决方案”对我'),('当你在 Linux 上启动一个进程时会发生什么？','2018-01-20 00:00:00','http://blog.jobbole.com/113506/','163e3c6dadc221edbe975926bad55ee5','http://jbcdn2.b0.upaiyun.com/2015/10/9aeba2223d66a3c6692233694383abce.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,3,3,'IT技术, 3 评论 ,Linux','本文是关于 fork 和 exec 是如何在 Unix 上工作的。你或许已经知道，也有人还不知道。几年前当我了解到这些时，我惊叹不已。\n我们要做的是启动一个进程。我们已经在博客上讨论了很多关于\n的问题，每当你启动一个进程或者打开一个文件，这都是一个系统调用。所以你可能会认为有这样的系统调用：\n这是一个合理的想法，显然这是它在 DOS 或 Windows 中的工作原理。我想说的是，这并不是 Linu'),('当 CPU 空闲时它都在做什么？','2018-02-07 00:00:00','http://blog.jobbole.com/113635/','181d7e4b5d17a319d62d2a93158b7432','http://jbcdn2.b0.upaiyun.com/2018/02/5127eb8de8c9e721e734ea303c0a8138.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,2,1,'IT技术, 1 评论 ,CPU','在 \n 我说了操作系统行为的基本原理是，\n，在一个 CPU 上\n。但是，如果 CPU 无事可做的时候，又会是什么样的呢？'),('汇编语言入门教程','2018-01-21 00:00:00','http://blog.jobbole.com/113509/','18c4d836f5ced027a8bc7f3f561f8a48','http://jbcdn2.b0.upaiyun.com/2015/03/6a6583a113036f92733762f47f315de4.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,5,0,'IT技术,汇编','学习编程其实就是学高级语言，即那些为人类设计的计算机语言。\n但是，计算机不理解高级语言，必须通过编译器转成二进制代码，才能运行。学会高级语言，并不等于理解计算机实际的运行步骤。\n计算机真正能够理解的是低级语言，它专门用来控制硬件。汇编语言就是低级语言，直接描述/控制 CPU 的运行。如果你想了解 CPU 到底干了些什么，以及代码的运行步骤，就一定要学习汇编语言。\n汇编语言不容易学习，就连简明扼要的'),('我见过的那些愚蠢的安全漏洞','2017-12-18 00:00:00','http://blog.jobbole.com/113343/','1960505fabd1be2e545f68a984679b36','http://jbcdn2.b0.upaiyun.com/2012/05/Security-logo.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,1,3,'IT技术, 3 评论 ,安全','【导读】：知名安全技术博主 Tony Hunt 吐槽了一些正规公司、正规网站的安全漏洞：HTTP + cookie 里明文存放用户名密码；输入用户名与生日就能重设密码；密保问题；邮箱绑定个人信息等等。\n我的朋友 Lars Klint 发过这条推：「你的密码并不是独一无二的」\n我顺手把它\n了出去，因为我知道还有比这更疯狂的事情。Twitter 用户没有把它当作一个\n，而是带着恐惧和指责评论它。事实上'),('Git 12 岁了，为你送上 12 个 Git 的使用技巧！','2018-04-16 00:00:00','http://blog.jobbole.com/113885/','19e82073707c6fead43789396f1c0f0a','http://jbcdn2.b0.upaiyun.com/2018/04/e38d25144c3ef2d81d73a884cacbf9c2.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,2,0,'IT技术,Git','使用这12个Git的诀窍与技巧来令你的版本控制经验更加有用。\nGit，一个分布式版本控制系统，它已经成为了开源世界的源码控制默认工具，在4月7号12岁了。但是使用Git中更另人沮丧的是，你需要了解多少才能让你更有效的使用它。同时这也是使用Git中比较美妙的一件事，因为没有什么比发现一个新的小技巧来简化或提高你的工作流的效率更加令人快乐了。\n为了纪念Git的12岁生日，这篇文章提供12个诀窍与技巧来'),('优化 MySQL： 3 个简单的小调整','2018-02-09 00:00:00','http://blog.jobbole.com/113659/','1ad3aad7d2d8f03329e86a7660386cd4','http://jbcdn2.b0.upaiyun.com/2015/11/e78e36715813f49e9e62fe0c6050075c.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,8,15,'IT技术, 15 评论 ,MySQL,数据库','我并不期望成为一个专家级的 DBA，但是，在我优化 MySQL 时，我推崇 80/20 原则，明确说就是通过简单的调整一些配置，你可以压榨出高达 80% 的性能提升。尤其是在服务器资源越来越便宜的当下。\n如果你还在使用 MyISAM 存储引擎，那么是时候转换到 InnoDB 了。有很多的理由都表明 InnoDB 比 MyISAM 更有优势，如果你关注性能，那么，我们来看一下它们是如何利用物理内存的'),('Redis源码阅读：sds字符串实现','2018-04-04 00:00:00','http://blog.jobbole.com/113798/','1bd4810b83c51a23ef605311000781f3','http://jbcdn2.b0.upaiyun.com/2016/04/49961db8952e63d98b519b76a2daa5e2.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,0,'IT技术,Redis','从开始工作就开始使用Redis，也有一段时间了，但都只是停留在使用阶段，没有往更深的角度探索，每次想读源码都止步在阅读书籍上，因为看完书很快又忘了，这次逼自己先读代码。因为个人觉得写作需要阅读文字来增强灵感，那么写代码的，就阅读更多代码来增强灵感吧。\nredis的实现原理，在《Redis设计与实现》一书中讲得很详细了，但是想通过结合代码的形式再深入探索，加深自己的理解，现在将自己探索的心得写在这儿'),('在 Linux 中自动配置 IPv6 地址','2018-03-14 00:00:00','http://blog.jobbole.com/113771/','1c7d5802b140adefb9805592b6a7e332','http://jbcdn2.b0.upaiyun.com/2018/01/1b8322e1daff605d71fc81e724421f17.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,2,1,'IT技术, 1 评论 ,IPv6,Linux','在 \n 一文中，我们学习了关于唯一本地地址unique local addresses（ULA）的相关内容。在本文中，我们将学习如何为 ULA 自动配置 IP 地址。\n唯一本地地址unique local addresses（ULA）使用 \n 地址块，它类似于我们常用的 IPv4 的私有地址：\n、\n、以及 \n。但它们并不能直接替换。IPv4 的私有地址分类和网络地址转换（NAT）功能是为了缓解 I'),('提升网站访问速度的 SQL 查询优化技巧','2017-12-09 00:00:00','http://blog.jobbole.com/113222/','1d272b3f5e772e150256c80369d176bd','http://jbcdn2.b0.upaiyun.com/2017/12/d58689380279e0a450fddedcbc06ffc3.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,1,1,'IT技术, 1 评论 ,数据库','你一定知道，一个快速访问的网站能让用户喜欢，可以帮助网站从Google 上提高排名，可以帮助网站增加转化率。如果你看过网站性能优化方面的文章，例如\n、到\n以及 \n，就认为你的 WordPress 网站已经足够快了。但是事实果真如此吗？\n使用动态数据库驱动的网站，例如WordPress，你的网站可能依然有