发现 Linux 性能瓶颈','2018-03-04 00:00:00','http://blog.jobbole.com/113696/','26b61ecede402bb81e74b4370bf364d7','http://jbcdn2.b0.upaiyun.com/2018/03/3791503078cd56e080b61c9795d145e9.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,0,'IT技术,Linux',' 命令用用收集、报告、或者保存 UNIX / Linux 系统的活动信息。它保存选择的计数器到操作系统的 \n 文件中。从收集的数据中，你可以得到许多关于你的服务器的信息：\n 命令的输出能够用于识别服务器瓶颈。但是，分析 \n 命令提供的信息可能比较困难，所以要使用 kSar 工具。kSar 工具可以将 \n 命令的输出绘制成基于时间周期的、易于理解的图表。\n、\n、和 \n 命令都是 sysstat 包的'),('邪恶的编程咒语','2018-03-12 00:00:00','http://blog.jobbole.com/113631/','2796ee392f681a8f36e227ce37a3b069','http://wx3.sinaimg.cn/large/7cc829d3gy1fo80ho6bhuj20fu09twfy.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,5,2,'开发, 2 评论 ,编程语言','自从我看了 Gary Bernhardt 备受推崇的一个视频 \n，就惊异于特定编程语言的怪异行为。相较于其他编程语言来说，某些编程语言的行为更出乎意料。例如，有\n是针对 Java 的边缘案例和古怪情况。同样，差不多只要 200 美元你就可以阅读 \n了。\n下面是我最喜欢的、惊奇的、滑稽的并仍然有效的咒语集合。一般来讲，利用这些古怪的行为被视为\n，因为代码不应该出乎意料。值得庆幸的是，如果你尝试以下大'),('PostgreSQL 查询成本模型','2017-12-21 00:00:00','http://blog.jobbole.com/113358/','2d2fe070e21aca17bf9d6ef863e27af3','http://jbcdn2.b0.upaiyun.com/2013/03/PostgreSQL-logo.gif','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,1,'IT技术, 1 评论 ,PostgreSQL,数据库','数据库查询速度如果太慢会从很多方面损害机构，比如可能会损害一些优秀应用程序的声誉，因为数据库查询速度过慢，造成后台处理速度慢得令人痛苦，并大幅增加基础设施的成本。作为一名经验丰富的Web开发人员，了解数据层的优化策略是绝对必要的。\n在本文中，我们将探讨PostgreSQL的成本模型，如何了解\n命令（关于explain命令可参见这篇\n）的输出，最重要的是如何利用这些模型数据来提高应用程序的吞吐量。\n'),('在 Linux 的终端上伪造一个好莱坞黑客的屏幕','2018-01-12 00:00:00','http://blog.jobbole.com/113471/','2f2cb92eda8ea71b6d6fba94287e069b','http://jbcdn2.b0.upaiyun.com/2015/10/008d9c47f50ab5eac3f349d238b3b6dc.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,2,1,'IT技术, 1 评论 ,Linux','我攻进去了！\n你可能会几乎在所有的好莱坞电影里面会听说过这句话，此时的荧幕正在显示着一个入侵的画面。那可能是一个黑色的终端伴随着 ASCII 码、图标和连续不断变化的十六进制编码以及一个黑客正在击打着键盘，仿佛他/她正在打一段愤怒的论坛回复。\n但是那是好莱坞大片！黑客们想要在几分钟之内破解进入一个网络系统除非他花费了几个月的时间来研究它。不过现在我先把对好莱坞黑客的评论放在一边。\n因为我们将会做相'),('Nginx 教程 （1）：基本概念','2018-01-28 00:00:00','http://blog.jobbole.com/113555/','2f8ffe8851bbe10af9d1063aee4be256','http://j