会讨论 VI/VIM 的命令以及选项。本文出于教学的目的，我们使用 V'),('软件复杂性正在杀死我们','2018-04-14 00:00:00','http://blog.jobbole.com/113820/','627fba360f907b35e30cde7e75e233df','http://ww3.sinaimg.cn/mw690/7cc829d3gw1ezy0oepjyrj21hc0u0wk6.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,2,1,'业界, 1 评论 ','代码量少了不代表软件的复杂度降低了，而是编程语言的表达力更强了。太多开发人员痴迷于框架，过度追求软件灵活性、可组合性等等，而忘记自己是不是真的需要这些。\n在有软件之前，只有黑暗。自从时代的黎明到来后，一直存在一个不变的事实：企业想要构建价格更低、运行更快的软件。\n当然，这是可以理解并且值得称赞的目标——尤其是你曾经花费时间跟软件开发人员打过交道。每个工程师都应该全心支持此目标，并且在当前环境的约束'),('越做越复杂的软件工程项目','2017-12-11 00:00:00','http://blog.jobbole.com/113146/','62dfe5b002b87b6d827600206c0ab7de','http://wx2.sinaimg.cn/mw690/63918611gy1fmd055iz98j21jk18814r.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,4,3,'IT技术, 3 评论 ,软件开发','你最开始想得很好。雇佣开发人员来构建出你的创业想法。但是几乎每一周，都感觉似乎项目需要做做调整，于是各种功能开始混进来，范围逐渐蔓延。\n仿佛这项目拥有了自己的生命，而且还试图毁掉你的生活。\n怎么会这样呢？你雇佣的开发人员很差劲吗？你对项目管理也只是摸着石头过河吗？还是这个想法从头到尾就是糟糕的？\n有可能。但一个核心误区通常会在一开始注定项目的失败。\n我们的假设是，给产品定义一系列的功能并记在纸上后'),('做 ML 有关的工作，需要哪些技能？','2018-01-30 00:00:00','http://blog.jobbole.com/113592/','63b2027895556ef17796fd078f2cca76','http://jbcdn2.b0.upaiyun.com/2017/12/914a7f9323808e5b11330f275e0ac4c8.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,19,11,'IT技术, 11 评论 ,机器学习','【导读】：有位网友在 Quora 上提问：做与机器学习有关的工作，需要些什么技能呢？\n这里有很多回复都提到了一些创业公司常用的工具。值得注意的是，在你 35 岁以上的职业生涯中，这些工具会变得完全不同。所以最好的办法是熟悉基本概念和数学。\n其次，机器学习领域太过繁杂，根本不可能真正深入理解几十种不同的算法。我觉得你可以先深究几个最有前景的算法。说是这么说，你也要很了解一些基础的东西才行，比如说朴素'),('数据库 schema 迁移数据最佳实践','2017-11-27 00:00:00','http://blog.jobbole.com/113079/','6430b256b627356fe28c427fcd33ae0e','http://jbcdn2.b0.upaiyun.com/2017/02/d96d4345a7d19d365cae211b5a3b2bbd.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,1,0,'IT技术,数据库,数据迁移',''),('2018 开发者技能调查：这些编程语言受欢迎','2018-01-25 00:00:00','http://blog.jobbole.com/113526/','6577977ccb5507514a22f0ef401d210d','http://wx2.sinaimg.cn/large/7cc829d3ly1fnrhvezgh4j20jx0aggm9.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,1,'开发, 1 评论 ,编程语言','近日国外开发者平台 HankerRank 发布了 2018 年开发者技能调查报告，本文摘录部分和编程语言相关的调查结果。\n尽管经常有新编程语言出现，但程序员需要掌握核心、传统语言也是非常重要的。 总的来说，在「雇主青睐的编程语言」中，JavaScript、Java、Python、C++、C、C# 和 PHP 排在前位。\nJavaScript 第一，Java 稍微比 JS 少一点排第二，Python'),('修复每个 bug 后都要问这 3 个问题','2017-11-15 00:00:00','http://blog.jobbole.com/112886/','67d204ef21c7f1606d8f9906b75d50ac','http://jbcdn2.b0.upaiyun.com/2017/11/9b01dc11ce460f8e1d3875d74a71fa8a.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,6,17,'开发, 17 评论 ,Bug','你是否曾经修复了一个 bug ，随后又发现了一个跟刚修复 bug 有关的 bug ，又或是修复 bug 的方式引起了另一个 bug ？当我修改 bug 时，我会问自己三个问题，以确保我已经仔细考虑了它的意义。每次你认为发现并修改了一个 bug 时，可以使用这些问题来提高生产力和代码质量。\n这些问题背后的主要思想就是：\n你必须处理这些症状，但如果你仅仅是处理这些外在症状，你就会有永远解决不完的问题。'),('浅谈微服务基建的逻辑','2017-11-27 00:00:00','http://blog.jobbole.com/113082/','6e136f448c198db45a3b7b0a5cc11600','http://insights.thoughtworks.cn/wp-content/uploads/2017/11/1-bare-service.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,5,1,'IT技术, 1 评论 ,微服务',''),('精通 Linux 的 “kill” 命令','2018-04-17 00:00:00','http://blog.jobbole.com/113894/','6e3fcf5927147f4633e5566c0c847b94','http://jbcdn2.b0.upaiyun.com/2017/05/77d80105fd15f2465894827e23cc4842.jpeg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,0,'IT技术,Linux','无论你使用哪种操作系统，你一定会遇到某个行为失常的应用，它把自己锁死并拒绝关闭。在Linux(还有Mac)，你可以用一个”kill”命令强制终结它。在这个教程中，我们将展示给你多种方式使用”kill”命令终结应用。\n当你执行一个”kill”命令，你实际上发送了一个信号给系统，让它去终结不正常的应用。总共有60个你可以使用的信号，但是基本上你只需要知道SIGTERM(15)和SIGKILL(9)。\n'),('软件开发工作的第一现场','2017-12-26 00:00:00','http://blog.jobbole.com/113385/','6ff9807fcfd11f7bd4902c340a1ce2ff','http://insights.thoughtworks.cn/wp-content/uploads/2017/12/feeling-1024x683.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,0,'其他,软件开发',''),('聊聊分布式事务，再说说解决方案','2018-02-01 00:00:00','http://blog.jobbole.com/112749/','70044049fff6d293d468dc718cb06690','http://jbcdn2.b0.upaiyun.com/2017/10/0923ab0f6010ed3be33f3fcb0b40a49c.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,8,1,'IT技术, 1 评论 ,分布式,数据库','分布式事务是企业集成中的一个技术难点，也是每一个分布式系统架构中都会涉及到的一个东西，特别是在微服务架构中，几乎可以说是无法避免，本文就分布式事务来简单聊一下。\n在说分布式事务之前，我们先从数据库事务说起。 数据库事务可能大家都很熟悉，在开发过程中也会经常使用到。但是即使如此，可能对于一些细节问题，很多人仍然不清楚。比如很多人都知道数据库事务的几个特性：原子性(Atomicity )、一致性( C'),('5 款最酷的 Linux 终端模拟器','2017-11-27 00:00:00','http://blog.jobbole.com/113109/','71754c69c41b20b379b2bc4a00851aee','http://jbcdn2.b0.upaiyun.com/2017/05/77d80105fd15f2465894827e23cc4842.jpeg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,0,'IT技术,Linux','虽然，我们可以继续使用老旧的 GNOME 终端、Konsole，以及好笑而孱弱的旧式 xterm。 不过，让我们带着尝试某种新东西的心境，回过头来看看 5 款酷炫并且实用的 Linux 终端。\n首先我要推荐的第一个终端是 \n。 Xiki 是 Craig Muth 的智慧结晶，他是一个天才程序员，也是一个有趣的人（有趣在此处的意思是幽默，可能还有其它的意思）。 很久以前我在 \n 一文中介绍过 Xik'),('剖析内存中的程序之秘','2018-03-04 00:00:00','http://blog.jobbole.com/113699/','742e67917a72f6ef4997410757b7b877','http://jbcdn2.b0.upaiyun.com/2018/03/916f9d62e323d9f101c7d545e3fc030e.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,6,0,'C/C++,内存','内存管理是操作系统的核心任务；它对程序员和系统管理员来说也是至关重要的。在接下来的几篇文章中，我将从实践出发着眼于内存管理，并深入到它的内部结构。虽然这些概念很通用，但示例大都来自于 32 位 x86 架构的 Linux 和 Windows 上。这第一篇文章描述了在内存中程序如何分布。\n在一个多任务操作系统中的每个进程都运行在它自己的内存“沙箱”中。这个沙箱是一个\n，在 32 位的模式中它总共有 '),('20 个 OpenSSH 最佳安全实践','2018-03-03 00:00:00','http://blog.jobbole.com/113692/','751b4a769751d2c4fdc8634943432f73','http://jbcdn2.b0.upaiyun.com/2013/02/linux-ssh.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,5,0,'IT技术,Linux,OpenSSH','OpenSSH 是 SSH 协议的一个实现。一般通过 \n 或 \n 用于远程登录、备份、远程文件传输等功能。SSH能够完美保障两个网络或系统间数据传输的保密性和完整性。尽管如此，它最大的优势是使用公匙加密来进行服务器验证。时不时会出现关于 OpenSSH 零日漏洞的\n。本文将描述如何设置你的 Linux 或类 Unix 系统以提高 sshd 的安全性。\nOpenSSH 服务支持各种验证方式。推荐使用'),('区块链入门教程','2018-01-04 00:00:00','http://blog.jobbole.com/113428/','7585aea4a928848a1b6aff7fffcd33d9','http://jbcdn2.b0.upaiyun.com/2018/01/40f9a81cba62930d7bdcff68162b27c0.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,8,4,'IT技术, 4 评论 ,区块链',''),('10 个用于 AI 开发的框架和库','2018-01-19 00:00:00','http://blog.jobbole.com/113499/','779ed9fa24a799a2c0bbfc7a4dcb5020','https://dashbouquet.com/assets/img/blog/tensorflow-example.png','D:\\myworkspace\\ArticleSpider\\Articl