ole.com/113312/','7b2e7df15f26a1c4ddc1a2388108ab71','http://jbcdn2.b0.upaiyun.com/2015/11/e78e36715813f49e9e62fe0c6050075c.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,2,0,'IT技术,MySQL,数据库','数据库系统与文件系统最大的区别在于数据库能保证操作的原子性，一个操作要么不做要么都做，即使在数据库宕机的情况下，也不会出现操作一半的情况，这个就需要数据库的日志和一套完善的崩溃恢复机制来保证。本文仔细剖析了InnoDB的崩溃恢复流程，代码基于5.6分支。\n 可以理解为数据库从创建以来产生的redo日志量，这个值越大，说明数据库的更新越多，也可以理解为更新的时刻。此外，每个数据页上也有一个lsn，表'),('如何在 Linux/Unix/Windows 中发现隐藏的进程和端口','2018-01-30 00:00:00','http://blog.jobbole.com/113593/','7b546d2831d0a697c88ce542ad53b7ee','http://jbcdn2.b0.upaiyun.com/2017/04/7a91ae8776d0953ac776284a7d92e861.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,2,0,'IT技术,Linux,Unix,Windows',' 是一个小巧的网络取证工具，能够发现那些借助 rootkit、LKM 及其它技术隐藏的进程和 TCP/UDP 端口。这个工具在 Linux、UNIX 类、MS-Windows 等操作系统下都可以工作。根据其 man 页面的说明：\n绝大多数的 Rootkit 工具或者恶意软件借助内核来实现进程隐藏，这些进程只在内核内部可见。你可以使用 \n 或者诸如 \n。\n这篇文章描述了如何安装 unhide 并搜索'),('把docker镜像当作桌面系统来用','2018-01-08 00:00:00','http://blog.jobbole.com/113448/','7b88426617fb1d20ba1260658b57c9c2','http://jbcdn2.b0.upaiyun.com/2014/01/382b1251c2cdb32cf334445596f97085.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,3,0,'IT技术,Docker',''),('索引表和 ES 的一点点思考','2018-03-08 00:00:00','http://blog.jobbole.com/113726/','7cb32f69be9fc1f56a8f1a54e4cf6b00','http://jbcdn2.b0.upaiyun.com/2011/11/go-out-of-the-three-errors-of-the-seo.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,0,'IT技术,搜索,数据库','在电商项目中，物理库存系统是个极其重要的系统，订单支付后，就会开始来占用物理库存。一般情况下，库存系统都是要分库的，因为主要的操作是写操作，例如占用/释放/取消等写操作。使用分库可以降低数据库写的压力。尽管写操作为主，但是读操作也是有的。\n比如说，库存占用的时候，得先查询是否有库存，而这个查询操作并不都会带上分库因子(用于路由到具体的某个数据库)，而是一些比较宽松的查询条件，这些查询条件对应的数据'),('为初学者准备的 Linux rmdir 命令案例教程','2018-02-19 00:00:00','http://blog.jobbole.com/113668/','7e8eafb653a560175f680851191cebac','http://jbcdn2.b0.upaiyun.com/2017/05/77d80105fd15f2465894827e23cc4842.jpeg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,0,'IT技术,Linux','在 Linux 命令行上删除文件和目录，我们已经讨论过 \n 的使用。然而，这里有另一个相关的命令行工具，专门针对目录的删除。这是所指的工具就是 \