学的天堂。\n但是他们拿到的'),('浅谈重构中踩过的坑','2017-12-20 00:00:00','http://blog.jobbole.com/113355/','85a1563f08476f99dd846fd88f85ca11','http://jbcdn2.b0.upaiyun.com/2017/12/93e463354f2ead2ca7ccb6a636eec994.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,3,1,'IT技术, 1 评论 ,重构','最近重构了公司一个将近10年的核心功能模块，踩了不少坑。在做这个重构的时候好几次都觉得做不下去，好几次压力都非常大，心想着我该不会做着做着就退出编程届了吧。\n不过还好，自己还是坚持下来了，回想写这个项目的时候自己曾三次推翻重来，那种心路历程真的只有经历了才知道，真是煎熬。后来回想起这一路踩过的坑，其实更多的是经验问题，而不是技术方面的问题。\n回顾做这个项目，我觉得心态问题是最重要的，技术问题倒是其'),('刚开始学编程？这几款小工具能让你事半功倍','2018-03-26 00:00:00','http://blog.jobbole.com/113785/','86a8795768a1192f6a4d22bbb49ab0d7','https://pic.36krcnd.com/201803/10141844/8fkz2ekh01zhphjt.jpeg!1200','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,7,1,'IT技术, 1 评论 ,Web前端,编程','科技行业里，可供人们使用的工具成百上千，你要怎么知道用哪一种上手最合适呢？\n拿最近刚进入编程这行的人来说吧，大量的工具信息堆砌过来其实毫无益处，反而会无从下手。我发现在自己的开发过程中，很多安装的扩展工具不仅没有真正起到助益作用，反而常常妨碍了正常的开发工作。\n我不是专家，不过随着时间的推移，我还是编制了一份工具清单，这些工具已经证明对我非常有用。如果你刚刚开始学习怎么编程的话，这个清单能给你提供'),('如何判断 Linux 服务器是否被入侵？','2017-12-06 00:00:00','http://blog.jobbole.com/113205/','876ee85ca3eab93b154bc72080cb1d99','http://jbcdn2.b0.upaiyun.com/2014/05/1389f92e6bd3378cb6e4522971b7db35.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',3,11,5,'IT技术, 5 评论 ,Linux','本指南中所谓的服务器被入侵或者说被黑了的意思，是指未经授权的人或程序为了自己的目的登录到服务器上去并使用其计算资源，通常会产生不好的影响。\n免责声明：若你的服务器被类似 NSA 这样的国家机关或者某个犯罪集团入侵，那么你并不会注意到有任何问题，这些技术也无法发觉他们的存在。\n然而，大多数被攻破的服务器都是被类似自动攻击程序这样的程序或者类似“脚本小子”这样的廉价攻击者，以及蠢蛋罪犯所入侵的。\n这类'),('Git 的 4 个阶段的撤销更改','2017-11-24 00:00:00','http://blog.jobbole.com/113097/','8c0c41a82d8a071c66cee932bc983942','http://wx1.sinaimg.cn/mw690/63918611gy1fltan48ktfj21hm12y7f5.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',6,17,1,'IT技术, 1 评论 ,Git','虽然\n诞生距今已有\n年之久，网上各种关于\n的介绍文章数不胜数，但是依然有很多人（包括我自己在内）对于它的功能不能完全掌握。以下的介绍只是基于我个人对于\n的理解，并且可能生编硬造了一些不完全符合\n说法的词语。目的只是为了让\n通俗化，使初学者也能大概了解如何快速上手\n。同时，下面所有讨论，我们都假设只使用一个分支，也就是主分支\n的情况，虽然这种作法并不符合\n规范，但是现实情况中绝大部分用户是直接在\n分'),('一个 IT 青年北漂四年的感悟','2018-02-01 00:00:00','http://blog.jobbole.com/113560/','8c2b134eaa2fb