用的IO接口，包括同步异步IO，IO合并等。本文简单介绍一下其内部实现，主要的代码集中在os0file.cc这个文件中。本文的分析默认基于MySQL 5.6，CentOS 6，gcc 4.8，其他版本的信息会另行指出。\n 日志先行技术，基本所有的数据库，都使用了这个技术。简单的说，就是需要写数据块的时候，数据库前台线程把对应的日志先写（'),('程序员如何规划职业路线？','2018-03-13 00:00:00','http://blog.jobbole.com/112048/','c8f7206fc12fb03862d494d19208fd22','http://jbcdn2.b0.upaiyun.com/2017/03/4f255bd43f956c3db484a99d448b198e.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,4,4,'职场, 4 评论 ,程序员,职场','社区中并不缺少有关软件工程师职业发展的文章，甚至可以说是泛滥。很多人都能在这个话题上说两句，三五年工作经验的编程老鸟也好，架构师也好，技术 VP 也好，CTO 也好，都有各自的看法与实践经验。没有哪一套方法是适用于所有人的，这一套软件工程师职业发展纲要，也不过是在你踽踽前行的路上，迷茫时可用来参考借鉴。你的核心竞争力，永远是你的自身实力。切记！\n众所周知，软件工程师要做的工作就是写代码，准确地说，'),('机器学习如何发现你喜欢的音乐','2018-04-13 00:00:00','http://blog.jobbole.com/113821/','c9d9c3009f6783bc6fdee771e14f8aa2','http://wx2.sinaimg.cn/large/7cc829d3gy1fq7l3ts6p3j20ps0ocq78.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,1,'IT技术, 1 评论 ','本周一，正如其它每个周一，一亿多 Spotify 用户每人都收到了一个崭新的歌单。这个叫做每周发现的歌单内混合了用户从未听过但是可能会喜欢的 30首歌曲。效果堪称神奇。\n我自己是 Spotify 的超级粉丝，对每周发现尤其喜爱。为什么呢？因为我觉得它懂我。它比我生命中的任何人都更清楚我的音乐品味。我很高兴每周它都能满足我的需求，一如既往地推荐一些我自己永远都不会找到或知道会喜欢的歌曲。\n对于那些两'),('日志的艺术（The art of logging）','2018-01-02 00:00:00','http://blog.jobbole.com/113413/','ca3846b5e25e9357415c9c823f73b25b','http://jbcdn2.b0.upaiyun.com/2018/01/e35c32748c5bfe52651ccc7d9338d0da.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,11,4,'IT技术, 4 评论 ,logging,日志','程序员学习每一门语言都是从打印“hello world”开始的，日志也是新手程序员学习、调试程序的一大利器。当项目上线之后，也会有各种各样的日志，比如记录用户的行为、服务器的状态、异常情况等等。打印日志似乎是一件很简单、不值得一提的事情。但是，当看到线上项目居然有这样的日志的时候，不禁想问问我们真的会打印日志吗？\n在我看来，打印日志是一门艺术，而且长期被程序员所忽视，本文尝试回答以下几个问题，分享'),('用系统日志了解你的 Linux 系统','2017-12-22 00:00:00','http://blog.jobbole.com/113363/','cb06a4d36e47328f43948f73aae5d512','http://jbcdn2.b0.upaiyun.com/2017/12/812cccb1d3c1ebac3ef67409d53aaa3d.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,0,'IT技术,Linux','本文摘自为 Linux 小白（或者非资深桌面用户）传授技巧的系列文章。该系列文章旨在为 LinuxMagazine 发布的第 30 期特别版 “\n” （基于 \n ）提供补充说明。\n本文作者是 Romeo S.，她是一名基于 PDX 的企业 Linux 专家，专注于为创新企业提供富有伸缩性的解决方案。\nLinux 系统日志非常重要。后台运行的程序（通常被称为守护进程或者服务进程）处理了你 Linux'),('如何统计 Linux 中文件和文件夹/目录的数量','2018-02-05 00:00:00','http://blog.jobbole.com/113624/','cdda3a99da973e9d84e59d245c3be916','http://jbcdn2.b0.upaiyun.com/2018/01/1b8322e1daff605d71fc81e724421f17.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,3,0,'IT技术,Linux','嗨，伙计们，今天我们再次带来一系列可以多方面帮助到你的复杂的命令。 通过操作命令，可以帮助您计数当前目录中的文件和目录、递归计数，统计特定用户创建的文件列表等。\n在本教程中，我们将向您展示如何使用多个命令，并使用 \n、\n、\n 和 \n 命令执行一些高级操作。 下面的命令将可用在多个方面。\n为了实验，我打算总共创建 7 个文件和 2 个文件夹（5 个常规文件和 2 个隐藏文件）。 下面的 \n 命令的输'),('最早做游戏设计与开发的女程序员','2017-12-30 00:00:00','http://blog.jobbole.com/113401/','d319eedfb1e9cbc1005652a308ca61e9','http://wx4.sinaimg.cn/mw690/7cc829d3gy1fmz312xf4mj207r09madg.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,0,'其他','第一批电子游戏程序员之一是一位年轻女性，那时她刚从高中毕业。\n四十年前，消费电子产品巨头 RAC 发布了 Studio II。这是一款可编程的电子游戏控制台，与 \n 一起，率先使用只读存储器盒（ROM cartridge）作为可交换的游戏媒体。\nRCA 的控制台永远没能比得上 Atari 的 VCS，Magnavox 的 Odyssey，或者 Mattel 的 Intellivision。而且现在'),('Nginx 教程（3）：SSL 设置','2018-02-09 00:00:00','http://blog.jobbole.com/113654/','d43c5c68c4e7077da639a9455e4b0e9a','http://jbcdn2.b0.upaiyun.com/2013/07/Nginx-Logo.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,5,0,'IT技术,Nginx,Web','大家好！分享即关怀，我们很乐意与你分享其他的一些知识。我们准备了一个 Nginx 指南，分为三个系列。如果你已经知道一些 Nginx 知识或者想扩展你的经验和认知，这个再合适不过了。\n我们将告诉你 Nginx 的运作模式、蕴含的概念，怎样通过调优 Nginx 来提高应用性能，或是如何设置它的启动和运行。\n创建这个系列，我们希望，一是作为参考书，可以通过快速查找到相关问题（比如 gzip 压缩，SS'),('刚收到了Facebook的Offer，我是这样为面试做准备的','2017-11-27 00:00:00','http://blog.jobbole.com/112739/','d536d700cabc5c76562a4106167c0110','http://jbcdn2.b0.upaiyun.com/2012/11/facebook-recruitment.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,3,0,'职场,Facebook,技术面试','我刚刚在硅谷的科技公司完成了 7 次现场面试，我收到了来自 Facebook 的软件工程师的职位 Offer。下面分享一下我是怎么为面试做准备的，以及我在这个过程中学到的东西。\n当我还在澳大利亚的大学学习计算机科学的时候，我总是想象着未来能成为硅谷的一名软件工程师。我希望自己未来能够到科技行业的创新中心硅谷去工作。这个目标让我充满了动力，它也让我能够更加专注地准备面试。\n为了更好地学习，我辞去了在'),('机器学习之Logistic回归算法','2017-12-05 00:00:00','http://blog.jobbole.com/113182/','d