0.upaiyun.com/2018/01/cedafbf342cc1fd53e35bf644f1c5c84.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,2,0,'访谈,Node.js,Ryan Dahl','【伯乐在线导读】：\n—————-\n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n \n '),('一个技术大牛对程序员招聘的吐槽和建议','2018-01-26 00:00:00','http://blog.jobbole.com/113532/','e81ca961a8c2d048c7cc921d4868bb72','http://jbcdn2.b0.upaiyun.com/2018/01/7dd60e003318e539f9469a088c0cac3b.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,7,24,'其他, 24 评论 ,招聘,程序员,职场','【导读】：James Bennett 是一个来自美国西弗吉尼亚州的程序员，Python Web 框架 Django 的核心团队成员之一。做过自由职业者，也做过全职工作。前端、后端都干过。James 对好工具充满热情，所以他一直参与 Django 框架的开发贡献，还有其他开源软件。\n本文是他对程序员招聘的吐槽，最后给了一些建议。\n说真的，让我去掉前面这句中“似乎”二字吧。\n很多人都曾抱怨处在招聘的一'),('数据库新动向 Oracle 与微软割据局面产生','2017-11-25 00:00:00','http://blog.jobbole.com/113100/','e8841b41611f2bb57d64abd2fa79d836','http://jbcdn2.b0.upaiyun.com/2017/03/4bae6998d00f180d42c7da716e3d0bb2.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,1,'IT技术, 1 评论 ,数据库','【IT168 评论】数据库是一个历久弥新的领域，每年有很多新的黑马产生，但是整体局面却又看不出大的变化。究其原因可能是老牌厂商占据了主要市场，新伙伴的加入只能稍改部分局面，却无法撼动大的格局。\n今年，DB-Engines指数和数据库领域都有了一些新的变化，既有新的组合产生，也有高歌猛进的黑马选手，同时也有不进则退的老牌选手。虽然，黑马选手无法撼动大局面，但是新鲜组合的诞生是否会创造出新局面呢?\n在'),('布隆过滤器:Google Guava类库源码分析及基于Redis Bitmaps的重构','2017-12-30 00:00:00','http://blog.jobbole.com/113396/','e8eb842f84448b7433a380c11c41c941','http://www.fullstackyang.com/wp-content/uploads/2017/09/bloom-filter.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,3,0,'开发,Bitmaps,BloomFilter,Guava,Redis,布隆过滤器','在网上已经有很多关于布隆过滤器的介绍了，这里就不再赘述，下面简单地提炼几个要点：\n目前已经有相应实现的开源类库，如Google的Guava类库，Twitter的Algebird类库，和ScalaNLP breeze等等，其中Guava 11.0版本中增加了BloomFilter类，它使用了Funnel和Sink的设计，增强了泛化的能力，使其可以支持任何数据类型，其利用murmur3 hash来做哈'),('谈谈程序员的离职和跳槽','2017-12-09 00:00:00','http://blog.jobbole.com/112809/','eb6cc8fd6536dae6eac7ae49fc72211b','http://ww1.sinaimg.cn/mw690/7cc829d3gw1eizj4ql2huj20eq0b0wfx.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,8,12,'职场, 12 评论 ,职场,跳槽','// 伯乐在线转注：原文写于 2012 年\n这篇文章是我在部门会议上一次发言的总结。之所以会有这次会议，是因为我的一名员工向我提出了辞职，在思索了几天后，我整理了一下自己的思路，于是便有了这次的会议和现在的这篇文章。\n（转载配图）\n这位员工辞职的原因主要有两个：\n既然其中的一个原因是薪水无法符合预期，那么首先要搞清楚的就是收入是由什么决定的。\n首先要说的一点就是：积累。积累就是你在这家公司所创造的'),('如何在 Linux 系统中通过用户组来管理用户','2017-12-06 00:00:00','http://blog.jobbole.com/113200/','ecb07428446047245a1f32f8ff966176','http://jbcdn2.b0.upaiyun.com/2014/04/e260ae4f5d153b25be87819b25ff0577.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,1,0,'IT技术,Linux','当你需要管理一台容纳多个用户的 Linux 机器时，比起一些基本的用户管理工具所提供的方法，有时候你需要对这些用户采取更多的用户权限管理方式。特别是当你要管理某些用户的权限时，这个想法尤为重要。比如说，你有一个目录，某个用户组中的用户可以通过读和写的权限访问这个目录，而其他用户组中的用户对这个目录只有读的权限。在 Linux 中，这是完全可以实现的。但前提是你必须先了解如何通过用户组和访问控制表（'),('如何在 Linux/Unix 中不重启 Vim 而重新加载 .vimrc 文件','2018-02-28 00:00:00','http://blog.jobbole.com/113688/','ed9d84e1efb32bae76c9aa720352c42f','http://jbcdn2.b0.upaiyun.com/2012/04/vim-logo.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,3,0,'IT技术,Linux','我是一位新的 Vim 编辑器用户。我通常使用 \n 来加载 \n 配置。而当编辑 \n 时，我需要不重启 Vim 会话而重新加载它。在 Linux 或者类 Unix 系统中，如何在编辑 \n 后，重新加载它而不用重启 Vim 呢？\nVim 是自由开源并且向上兼容 Vi 的编辑器。它可以用来编辑各种文本。它在编辑用 C/Perl/Python 编写的程序时特别有用。可以用它来编辑 Linux/Unix 配置'),('他们是优秀的前端，所以这些后端工作也交给他们…','2017-12-07 00:00:00','http://blog.jobbole.com/113210/','f2c65dccf718330f513e67e843e7c14f','http://wx4.sinaimg.cn/mw690/7cc829d3gy1fkm7cqqsr0j20m40er0tm.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',3,4,11,'职场, 11 评论 ,程序员','我多次听经理或招聘人员说，优秀工程师是可以与其他优秀工程师交换的。他们可能会说，“首席工程师为这个项目选择了 F# 语言，如果外面没有太多的 F# 开发者，那么有几年经验的优秀开发者应该也还不错。”\n我还听说过一些这样的言论，“我知道他们是前端人员，但我们现在需要他们做些后端工作。因为他们本身很优秀，所以这没什么大不了的。”\n如果你相信这些蠢话，那我都可以把布鲁克林大桥卖给你了。我还创立了下一个独'),('励志！海外开发者讲述用脚做游戏的研发经历','2018-03-08 00:00:00','http://blog.jobbole.com/113722/','f7fd5491f869ff395a8d3670134dea28','http://jbcdn2.b0.upaiyun.com/2018/03/f4b90537c9da89d7b415ea699c9fe008.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,0,'IT技术,开发者','对于游戏开发者而言，失去双手对于职业和生活可能是灾难性的打击。'),('操作系统级虚拟化概述','2018-01-09 00:00:00','http://blog.jobbole.com/113459/','f9947ec196965902f6858b2ff93b9565','http://jbcdn2.b0.upaiyun.com/2018/01/1b8322e1daff605d71fc81e724421f17.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,0,'IT技术,虚拟化',''),('分布式、服务化的 ERP 系统架构设计','2017-12-07 00:00:00','http://blog.jobbole.com/113174/','fa24eafc29a7a991a5f4b675e3fe9aab','http://jbcdn2.b0.upaiyun.com/2013/03/architecture.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,4,3,'IT技术, 3 评论 ,分布式,架构','曾几何时，我混迹于电商、珠宝行业4年多，为这两个行业开发过两套大型业务系统（ERP）。作为一个ERP系统，系统主要功能模块无非是订单管理、商品管理、生产采购、仓库管理、物流管理、财务管理等等。作为一个管理系统，大家的一般开发习惯就是使用.Net或Java技术，建立一个单块（单进程）架构的应用，只有一个SQLServer或MySql数据库。然后在项目文件中分一下各个模块，三层结构方式组织代码编写开发'),('为什么程序员找不到工作：4 个恐怖故事','2018-02-09 00:00:00','http://blog.jobbole.com/113652/','faa133da176278b989688f2d8a18866d','http://wx1.sinaimg.cn/mw690/7cc829d3gy1foa9eb5fb0j20m80etdi0.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',3,3,7,'职场, 7 评论 ,程序员,职场','【伯乐在线导读】：当求职被拒时，我们多半会认为是自己的错：“我被三家公司拒了，我可能是一个差劲的工程师。”招聘比你想象的还要复杂。工程师出身的技术猎头 Iwan 在本文讲了 4 个故事，那些优秀的工程师，因为一些无关技术水平或文化契合等原因，遭到拒绝。\n以下是全文：\n我做了很长一段时间的技术招聘后，我可以向你保证，招聘过程中的随机因素和干扰因素（\n）也很重要。通常，拒绝是由于发生的偶然事件和一些不'),('搭建Keepalived + Nginx + Tomcat的高可用负载均衡架构','2017-12-18 00:00:00','http://blog.jobbole.com/113347/','fb10c29fd52231cba79635856a16c3f9','http://jbcdn2.b0.upaiyun.com/2013/07/Nginx-Logo.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',2,3,1,'IT技术, 1 评论 ,Keepalived,Nginx,Tomcat','初期的互联网企业由于业务量较小，所以一般单机部署，实现单点访问即可满足业务的需求，这也是最简单的部署方式，但是随着业务的不断扩大，系统的访问量逐渐的上升，单机部署的模式已无法承载现有的业务量，需要进行服务集群化部署，本文主要介绍服务端Tomcat多实例部署，以及如何保证web服务的高可用方案。\n如下图：为典型的Tomcat服务多实例部署的架构图\n（1）用户通过域名请求到DNS，由DNS解析域名后返'),('SQL 入门','2018-04-14 00:00:00','http://blog.jobbole.com/113879/','fcc6df41d82a46e2ff4b2aa2b977da7e','http://jbcdn2.b0.upaiyun.com/2016/01/970c5be7812066919173f6ec5ab052ce.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,0,'IT技术,数据库','使用 SQL 构建数据库比大多数人想象得要简单。实际上，你甚至不需要成为一个有经验的程序员就可以使用 SQL 创建数据库。在本文中，我将解释如何使用 MySQL 5.6 来创建简单的关系型数据库管理系统（RDMS）。在开始之前，我想顺便感谢一下 \n，这是我用来运行脚本的工具。它提供了一个用于测试简单脚本的有用的沙箱。\n在本教程中，我将构建一个使用如下实体关系图（ERD）中显示的简单架构的数据库。数'),('学数字设计的软件工程师该了解的时钟知识','2017-12-26 00:00:00','http://blog.jobbole.com/113215/','fda34f2acb731c915e85fe9c4c5dfeaa','http://jbcdn2.b0.upaiyun.com/2017/12/14464260f3d26e25c16cf5131a6b2a95.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,0,2,'开发, 2 评论 ','如果你有软件工程师背景，想找一份数字设计工程师的工作，那么你需要做的第一件事就是尽可能早的学习时钟概念。对很多从软件工程师转来的初级硬件设计工程师来说，时钟概念都是一件恼人的事情。如果没有时钟，他们就可以将 HDL（Hardware Description Language，硬件描述语言）转换为一种编程语言，如 $display，if 和 for 循环，如同其他的任何编程语言一样。 然而，这些初级'),('QA 请勿忘初心','2017-11-13 00:00:00','http://blog.jobbole.com/112869/','fe58b7c13975dd81b62637221bf079a7','http://insights.thoughtworks.cn/wp-content/uploads/2017/11/1-Quality-Assurance-725x1024.png','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,1,1,'IT技术, 1 评论 ,QA','让我们回顾一下QA与QC的区别：\nQA的工作涉及软件研发流程的各个环节，且涉及到每一位参与研发的人员，但质量保证工作又不涉及具体的软件研发细节，侧重于整个流程。\nQC则侧重于点，利用各种方法去检查某个功能是否满足业务需求。\nThoughtWorks 的QA则是这两者的混合体，既要保证开发流程的质量，又要保证Story的功能正确。\n我来ThoughtWorks已经3年了，当过BQConf讲师与主持人'),('如何处理前任程序员留下的代码','2017-11-28 00:00:00','http://blog.jobbole.com/113130/','feca1912a4a2171c56a8aa2694d80c5e','http://jbcdn2.b0.upaiyun.com/2017/01/d8ff4fd532a1a30d821049d62c62d106.jpg','D:\\myworkspace\\ArticleSpider\\ArticleSpider\\images',1,3,2,'开发, 2 评论 ,代码,测试','身为一个软件工程师，我们不可避免的会遇到这样一些问题：不得不修改别人的代码，或者在别人的代码中添加新的功能。我们并不熟悉这些代码，它也可能在整个系统中与我们编写的部分无关。虽然这样的工作很困难，容易让人感到无奈，但是要达到足够的灵活性来也别的开发者一起编写代码，收获也蛮大的。这些收获包括提高影响力，修复烂软件，还能学到系统中以前并不了解的部分（还可以从其它程序员那里学到技术和技巧）。\n在其它开发者');
