INSERT INTO `lagou_job` VALUES ('https://www.lagou.com/jobs/3477407.html','ba7174605d28229410f0abdc28eec1cf','大客户销售经理（教育）','10k-15k','杭州','经验1-3年','大专及以上','全职','13:44  发布于拉勾网','经理,市场拓展,销售,教育,渠道','前景好,行业优势','\n        岗位职责：\n1、负责公司信息化软件系统产品解决方案销售和市场拓展工作；\n2、根据市场营销计划，完成部门销售指标；\n3、开拓新市场，发展新客户，增加产品销售范围；\n4、负责辖区市场信息的收集及竞争对手的分析；负责销售区域内销售活动的策划和执行，完成销售任务；\n6、及时跟进客户，做好客户关系的维系和定期回访工作，建议良好的长期合作关系；\n7、负责按时向部门经理提交书面的工作总结，接受部门经理对业务的指导；\n8、负责完成公司交办的其它事宜。\n\n任职要求：\n1、大专及以上学历，市场营销、计算机、软件等相关专业，有事业心和上进心；\n2、2年以上大客户销售经验；熟悉软件行业销售流程，对市场营销工作有较深认知；\n3、具备一定的市场分析及判断能力，良好的客户服务意识，能独立处理和解决所负责的任务；\n4、高度的工作热情，积极主动，良好的团队协作精神；\n5、能适应出差；\n6、从事教育类行业产品的市场开拓，或在教育行业有从事工程项目的实际操作经验，尤其是在中小学领域有开拓市场，有实际开发客户业绩与人脉资源者可放宽条件；\n\n        ','杭州 -西湖区 -古墩路- 一西路522号西溪科创园','https://www.lagou.com/gongsi/79918.html','杭州善文信息科技有限公司','2017-11-07 14:55:44'),('https://www.lagou.com/jobs/3685955.html','25660a099c885cca36cfbd898629de16','互联网餐饮销售顾问','8k-10k','厦门','经验1-3年','大专及以上','全职','14:29  发布于拉勾网','移动互联网,销售,客户代表,团购','团队氛围好、股票期权、五险一金','\n        岗位职责：1、了解和发掘客户需求及购买愿望，介绍公司产品的优点和特色；2、维护客户关系，收集潜在客户资料，对客户提供专业的咨询；3、充分挖掘自身工作潜力，收集一线营销信息、用户意见、当地市场信息、竞争对手信息等，对公司提出参考意见，并树立企业形象；任职要求：1、 认真负责，对工作有激情，有上进心，热爱销售工作，有强烈的成功欲望和企图心；2、精力充沛，抗压力强；3、具备较强的人际沟通能力，及逻辑思维能力；福利待遇：亲们``````在客如云这个大家庭1.收入：收入是上可观的 高额底薪+绩效奖金+高提成；2.福利：五险一金（公积金）是不用愁的 公司提供完善的社会保障；工作之用，员工会人手分配一个ipad，高端大气上档次；3.期权：期权是够得着的，优秀老员工可以享受公司期权；4.培训：培训是免费的，公司内部有国家一级培训师长期专业授课，优秀员工会派往公司总部或外部培训；5.晋升：晋升是不靠关系的，纯净的上下级关系，越努力越幸运；6.团建：团建是常有的，每人每月享有基本的团队建设活动经费，供大家聚会或郊游；7.氛围：氛围是融洽的，都是年轻人，大型移动互联网O2O企业帅哥靓妹保证饱你眼福；8.前景：自豪感是油然而生的 本公司是由互联网巨头投资占股的大型移动互联网企业，前景无限；\n        ','厦门 -思明区- 帝豪大厦','https://www.lagou.com/gongsi/7551.html','客如云科技（北京）股份有限公司','2017-11-07 14:55:56'),('https://www.lagou.com/jobs/3693804.html','4df19a1fe857700243cd12af702250b3','仓储组长/品控','4k-6k','杭州','经验不限','大专及以上','全职','14:34  发布于拉勾网','QA,质检,品控,仓储','福利待遇好,每年调薪,上升空间大','\n        工作内容：\n1、协助仓库主管完成日程工作；监督仓库产品的合格货品入库、杜绝不合格货品入库；\n2、协助制定和执行公司质量管理体系、流程及管理办法；\n3、对包装整个生产过程进行监控，有效控制不合格的产生，出现不合格采取有效措施，是损失降到最低；\n4、负责半成品入库前的抽检，负责产成品的最终检验，制定相关检验标准及检验办法；\n\n