品经理,移动','车辆网,空间大,六险一金','\n        1、充分了解用户（内部或外部）需求，收集用户反馈，分析用户行为及需求，对产品进行持续的优化和改进；\n2、根据产品需求，撰写详细的产品设计文档和原型设计文档；\n3、协调开发人员进行开发工作，推动及协调产品的开发速度，把控项目质量；\n4、持续跟踪产品线的效果，分析产品、用户体验、满意度与转化率等核心指标；\n5、对产品数据进行监控，提升整体产品的用户满意度，对数据进行分析和统计。\n任职要求：\n1、3年以上互联网产品经理工作经验，有成功产品规划及设计案例。\n2：熟悉产品实施过程，包括市场分析、需求分析、产品功能设计、业务流程设计、界面设计、用户研究和可用性测试等；熟悉产品开发上线迭代流程，熟悉项目进度管理；优秀的产品规划设计能力，熟练掌握Axure，visio，mindmanager，office等工具； \n3：具有较强的沟通能力、逻辑能力和产品设计能力，对数据敏感，具备较强分析加工能力；\n4：较强的用户需求判断、引导、控制能力，善于合作协调沟通，思维敏捷，具有非常好的书面和口头表达能力；\n5：具有强烈的责任心和上进心，具备良好的团队合作精神，主动执行意识，能承受较大的工作压力。 \n工作地址\n北京市朝阳区安定路33号化信大厦A座15层\n\n        ','北京 -朝阳区- 安定路33号化信大厦A座15层','https://www.lagou.com/gongsi/53284.html','北京车联天下信息技术有限公司','2017-11-08 15:24:54'),('https://www.lagou.com/jobs/2095842.html','3f8730b1987108da60eb646a525aa8a8','测试工程师','15k-25k','上海','经验5-10年','本科及以上','全职','2天前  发布于拉勾网','测试','弹性工作,扁平化管理,年假病假,股票期权','\n        岗位职责：\n1、负责产品的测试工作的管理及指导工作，组织测试、设计测试用例、跟踪新产品及更新换代产品，提高产品上线质量。\n2、全局考虑产品的测试需求，组织定制有效的测试策略和方案，前瞻性考虑产品的全流程测试策略与方法，并对产品上线质量负责；\n3. 领导公司测试技术发展方向, 提高测试团队整体作用；\n4. 规划和设计符合公司产品特点的测试平台，优化产品研发测试过程；\n5、对公司产品的质量负责。\n任职资格：\n1. 五年以上互联网行业测试工作经验，三年以上互联网行业测试团队管理经验；\n2. 具备丰富的大型复杂系统软件测试经验；\n3. 有较强的分析设计能力，测试框架研发和方案整合能力；\n4. 熟练运用LoadRunner、QTP等测试工具和bug管理工具；\n5. 熟悉并能熟练编写Junit、XCTest、Robotium、AndroidTest等单元测试脚本\n6. 熟悉功能测试、自动化测试，性能测试，协助提升产品及平台的正确性及稳定性\n7.正直、热爱团队，有比较成功的培育和发展团队（4人以上）的经历，能提升团队绩效；\n8.具备业务、团队和技术等方面的前瞻性，关注行业动态、前沿技术；\n9.出色的推动能力，很强的学习能力和分析、解决问题能力。\n\n        ','上海 -杨浦区 -五角场- 上海市杨浦区淞沪路388号创智天地7号楼605','https://www.lagou.com/gongsi/126467.html','上海商米科技有限公司','2017-11-08 15:24:54'),('https://www.lagou.com/jobs/3772319.html','f7078a0fb6ac801db68dd18d4f6f4d6a','测试工程师','13k-25k','上海','经验3-5年','本科及以上','全职','1天前  发布于拉勾网','本地生活,资深,高级,中级,大数据,测试','绩效奖金；年终奖金；免费餐饮；硅谷文化','\n        职位描述：\n岗位描述：1.参与产品测试（移动端&amp;Web&amp;H5）的全流程，包括参与需求分析、设计评审，制定测试计划，设计和执行测试用例，进行缺陷跟踪定位，协助开发工程师解决问题等；2.开发自动化测试框架、自动化脚本，进行自动化测试，构建CI持续集成环境，提高测试效率。 岗位要求：1.计算机或其他相关专业正规统招本科及以上学历，3年及以上测试相关经验，2年以上自动化测试经验；2.熟悉linux操作系统，熟悉Python，会Django者优先考虑3.熟悉数据库的基本操作。4.熟悉基于Web/iOS/Android产品的自动化测试框架（appium,macaca,robotframework）5.有很强的分析能力和定位问题的能力，快速学习能力强；具有良好的沟通能力、细心负责、有团队精神。\n【我们看到什么】\n\n在他人看来，交易不过是简单的消费收费，冰冷的团购打折。\n在我们眼中，交易更是一段必然缘份的开始，一份专属关怀的延续。\n改写顾商交互模式，打造消费大数据平台，我们愿意与你共享温暖愿景。\n\n【我们经历什么】\n\n2011年，Fivestars诞生于美国硅谷，迅速发展成为美国最大的中小商户会员忠诚度管理系统，和估值近十亿美金的SaaS公司。\n\n2015年，再惠创立。Fivestars的最早期核心工程师，看到了体量更大更密的中国市场的潜力，为打造连接千万商户和亿万消费者的消费数据平台，毅然回国。\n\n天使轮融资，真格基金和光速资本（大众点评和FiveStars的投资人）看到了我们所看到的愿景，相信我们团队所能到达的远方。\n\n2016年，再惠探索出更适合中国本土市场的模式，用更成熟完善的技术，在短短五个月内就赶超了Fivestars近两年的发展。\n\nA轮融资，DCM（FiveStars的另一投资人）看到了我们出色的产品和业绩，也选择站在了我们的身后。\n2017年，再惠将会迎来上万家入驻商户，百万C端消费者，定制化和人性化顾商交互流程。\n\n【我们都是谁】\n\n我们的创始团队，有Carnegie Mellon校友Fivestars早期核心工程师负责技术，UC Berkeley的校友负责产品，Stanford的校友负责财务，点评的前高管负责销售。\n\n我们的早期团队，有在交大，同济，Boston College等打过怪的伙伴，在Microsoft，LinkedIn，SAP，美团点评等练过级的队友。\n\n【你来做什么】\n\n再惠是一家产品导向的互联网公司。从web到tablet到mobile到机器学习算法，从to B到to C，我们有多条产品线，可供你挑选你热爱和擅长的项目，也支持你的自我挑战和创新，探索你从未接触过的产品。\n\n作为工程师，你不仅可以钻研有挑战、感兴趣的技术，还可以了解和参与产品设计。\n\n同时，你还可以学习产品和项目管理，接触中国本地生活服务类行业百态，更全面的提升和成长自我。\n\n【我们能给你】\n\n我们会为你提供丰厚的薪酬福利，创造最好的成长学习和自我实现的环境：\n - 市场优势薪酬＊14，外加高至＊3的奖金；\n - 丰厚的期权计划，跟公司一起发展成长的机会；\n - 每周团队内部分享会，季度的业界大牛分享会，你和团队一起进步；\n - 弹性的工作时间，灵活的休假制度；\n - 免费的午餐+晚餐，其乐融融的拼菜文化；\n - 内内临近三条地铁线的办公室，你的出行便利也是公司的考虑；\n - 季度团建游，年度出国游，海岛阳光、五星酒店、私人沙滩等你哦\n\n        ','上海 -长宁区 -交通大学- 上海市长宁区淮海西路432号凯利大厦2楼','https://www.lagou.com/gongsi/86312.html','再惠（上海）网络科技有限公司','2017-11-08 15:24:55'),('https://www.lagou.com/jobs/3712316.html','c6abba36d3a7cbba68c66f4a9379015c','测试工程师','15k-25k','上海','经验3-5年','本科及以上','全职','1天前  发布于拉勾网','游戏,高级,web,Java,测试','双休,五险一金,年终奖','\n        岗位职责：\n1、能够根据项目需求规格说明书，编写测试计划，制订测试用例并实施，保证项目质量和进度；\n2、能够与产品经理和项目经理和开发工程师就项目需求、进度和bug进行沟通；\n4、能够独立负责一个项目的测试，能按时保质保量的完成测试工作，负责bug生命周期的管理；\n5、项目移交测试前能编写出完整的测试用例、并提交测试用例清单；\n6、测试阶段尽可能发现缺陷，及时与开发、产品沟通设计上遇到的问题，并且每天提交测试报告；\n7、定期提交周报，向上级汇报本周已完成的工作，下周的工作计划，碰到的问题，经验总结等。\n \n任职要求：\n1、计算机及相关专业本科学历，具有扎实的计算机基础知识，1年以上开发经验+3年以上测试经验；\n2、工作认真细致、积极主动，学习能力强，善于思考和总结；\n3、精通性能测试开发语言或工具（如Python，JMetter等)优先。\n\n        ','上海 -浦东新区 -三林- 灵岩南路295号三林世博创意园','https://www.lagou.com/gongsi/131778.html','资鼎（上海）互联网金融信息服务有限公司','2017-11-08 15:24:55');
